import React from 'react';
import Grid from '@mui/material/Grid';
import Section from "../Section";
import gt from '../../pictures/GeorgiaTech.png';
import osu from '../../pictures/OhioState.png';
import onlineCourses from "../../pictures/OnlineCourses.jpeg";

function Education() {
    return (
        <Grid 
            container
            direction="column" 
            justifyContent="flex-start" 
            spacing={5}
        >
            <Grid 
                item                
                sx={{
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    width: 1
                }}
            >
                <Section
                    title="Georgia Institute of Technology"
                    subtitle="M.S. Computer Science"
                    img={gt}
                    alt="Georgia Tech"
                    imgWidth="0.8"
                    infoList={[
                            ["Expected Graduation: May 2025", ""],
                            ["GPA: 4.0"],
                            ["Class Highlights", "Graduate Introduction to Operating Systems, Machine Learning for Trading, Bio-Inspired Computing, Knowledge Representation and Reasoning"]
                    ]}
                />
            </Grid>
            <Grid
                item                
                sx={{
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    width: 1
                }}
            >
                <Section
                    title="Ohio State University"
                    subtitle="B.S. Biomedical Engineering"
                    img={osu}
                    alt="Ohio State"
                    imgWidth="0.8"
                    infoList={[
                            ["Graduated: 2019"],
                            ["GPA: 3.4"],
                            ["Class Highlights", "Calculus, Organic Chemistry, Biomechanics, Biochemistry, Quantitative Physiology, Programming C++, Product Design Engineering"]
                    ]}
                />
            </Grid>
            <Grid 
            item                
            sx={{
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                width: 1
            }}
        >
            <Section
                title="Rogue Fitness"
                subtitle="Product Design Engineer"
                img={onlineCourses}
                alt="Rogue Fitness"
                imgBorderRadius="10px"
                imgWidth="0.8"
                infoList={[
                        ["Designed and managed products from inception through launch and early sales.", ""],
                        ["Actively collaborated with the owner/CEO, Director of Product Development, and other engineers to solve challenging design problems.", ""],
                        ["Considered several factors, such as product function, cost, manufacturability, design aesthetics, speed of product packaging, ease of customer assembly, etc., in order to design well-received products.", ""],
                        ["Inventor on several granted and pending design and utility patents", ""]
                ]}
                link="true"
                linkText="More Info"
                href="/rogue-fitness"
            />
        </Grid>
        </Grid>
    );
}

export default Education;
